script: |
  super -f text -I q5977.spq | sort > q5977.out

inputs:
  - name: q5977.spq
    data: |
      SELECT DISTINCT + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 72 IN ( col0, col2 * - col0 * - col1, + 85 );
  - name: tab0

outputs:
  - name: q5977.out
    data: |
      15
      87
      97
